                <div className="ban-full-sec1 aem-GridColumn aem-GridColumn--default--8">
                    <img src={mountain} alt="Mountain" />
                </div>
                <div className="ban-full-sec2 aem-GridColumn aem-GridColumn--default--4">
                    <h2>Conquer your next adventure</h2>
                    <span>Lorem Ipsum Dolor Tempor</span>
                    <button>SHOP DEVICES</button>
                </div>
            </section>
        </>
    );
}
